description:
CHÍNH CHỦ GỬI BÁN 44M2 ĐẤT PHÂN LÔ - NỞ HẬU - NGÕ ÔTÔ TỔ 6 YÊN NGHĨA GIÁ 2.45 TỶ.

* Diện tích 44m2 phân lô, nở hậu, vuông vắn;

* Vị trí: Tổ dân phố 6 phía trong đê Yên nghĩa, cách Bến xe Yên nghĩa 300m, cách vành đai 4 đang thi công 200m, cách Đại học Phenika 800m; bệnh viện Nhi đang thi công 1km;

* Khu vực tiềm năng phát triển, thuận tiện giao thông;

* Sổ đỏ chính chủ, phân lô vuông vắn sẵn sàng giao dịch;

Liên hệ Hoàng Hiệp xem vị trí và làm việc chính chủ.
